function configChart(data) {
  //   console.log(_apiItem);
  const testData = data
    .filter((item, idx) => {
      if (idx % 5 === 0) {
        return item.positive;
      }
    })
    .map(filt => {
      return filt.positive;
    });

  return testData;
}

function configChartDates(data) {
  //   console.log(_apiItem);
  const testData = data
    .filter((item, idx) => {
      if (idx % 5 === 0) {
        return item.dates;
      }
    })
    .map(filt => {
      return filt.dates;
    });

  return testData;
}

export { configChart, configChartDates };
